const Post = ({ post }) => {
  const lineupElements = post.assignments.map((assignment, i) => {
    const roleElements = post.assignments;

    return <div key={post._id + "role" + i}>{assignment.role + ": "}</div>;
  });
  const songElements = post.songs.map((song, i) => {
    return <div key={post._id + ":song:" + i}>{song.title}</div>;
  });

  return (
    <div className="post">
      <div className="lineup">
        Lineup:
        {lineupElements}
      </div>
      <div className="songs">
        Songs:
        {songElements}
      </div>
    </div>
  );
};

export default Post;
